defmodule ProtectoraWeb.ImaxePublicacionViewTest do
  use ProtectoraWeb.ConnCase, async: true

  # Bring render/3 and render_to_string/3 for testing custom views
  import Phoenix.View
  import ProtectoraWeb.ImaxePublicacionView

  @imaxe_string %{
    imaxe_publicacion: [
      %{
        id: "id-example",
        path_imaxe: "priv/static/animais/5d18f2ac-ae55-4b40-b11b-9f0d5d977bc8-images.jpeg"
      }
    ]
  }

  @imaxe %{
    imaxe_publicacion: %{
      id: "id-example",
      path_imaxe: "priv/static/animais/5d18f2ac-ae55-4b40-b11b-9f0d5d977bc8-images.jpeg"
    }
  }

  describe "ImaxePublicacionView test" do
    test "renders index" do
      rendered_json = ProtectoraWeb.ImaxePublicacionView.render("index.json", @imaxe_string)

      assert rendered_json == %{
               data: [
                 %{
                   id: "id-example",
                   imaxe64:
                     "data:image/gif;base64,"
                 }
               ]
             }
    end

    test "renders show" do
      rendered_json = ProtectoraWeb.ImaxePublicacionView.render("show.json", @imaxe)

      assert rendered_json == %{
               data: %{
                 id: "id-example",
                 imaxe64:
                   "data:image/gif;base64,"
               }
             }
    end
  end
end
